// Landing Services ------------------------------------

.Landing_Services {
    width: 100%;
    padding-top: 80px;
}

    .Landing_Services-Wrap {
        width: 100%;
        height: 100%;
        position: relative;
    }
        //Intro
        .Landing_Services-Intro {
            width: 100%;
            display: flex;
        }

            .Landing_Services-IntroHeader {
                width: 50%;
                font-size: 70px;
                font-weight: 600;
                letter-spacing: -1px;
                transition: font-size .5s ease-in;
            }

            .Landing_Services-IntroRight {
                width: 50%;
                padding-top: 160px;
                padding-left: 40px;
            }

                .Landing_Services-Intro-Description {
                    font-size: 20px;
                    font-weight: 400;
                    line-height: 40px;
                    margin-bottom: 40px;
                }

        .Landing_Services-BreakDown {
            width: 100%;
            margin-top: -100px;
        }

            .Landing_Services-BreakDown-Title {

            }

            .Landing_Services-BreakDown-Item {
                display: flex;
                align-items: center;
                margin-bottom: 40px;
            }

                .Landing_Services-Icon {
                    width: 30px;
                    margin-right: 40px;
                }

                .Landing_Services-BreakDown-Text {
                    font-size: 28px;
                    color: #969696
                }   
        .Landing_Services-Photos {
            width: 100%;
            position: relative;
            margin: 100px 0;
        }

            .Landing_Services-Photos-Wrap {
                width: 100%;
                display: flex;
                padding: 0 20px;
                justify-content: space-between;
            }

                .Landing_Services-Photo {
                    box-shadow: 5px 5px 30px #1414142c;
                    margin: 0 5px;
                }

                    .Landing_Services-Photo1 {
                        width: 50%;
                        height: 19vw;
                    }

                    .Landing_Services-Photo2 {
                        width: 50%;
                        height: 35vw;
                        max-height: 900px;
                    }

